(49, 48, 'Pregnancy terminated by a spontaneous abortion.', 'en', 1, '2004-01-01 00:00:00', 1, '2012-10-09 21:18:04', '49FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(107, 108, 'A contraction of smooth muscle in the walls of the bronchi and bronchioles, causing narrowing of the lumen.', 'en', 1, '2004-01-01 00:00:00', 1, '2014-08-05 16:15:02', '107FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(110, 111, 'A disorder of digestive function characterized by discomfort or heartburn or nausea.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:44:08', '110FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(120, 121, 'Muscular pain or tenderness, especially when diffuse and nonspecific.', 'en', 1, '2004-01-01 00:00:00', 1, '2014-07-12 01:12:26', '120FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(123, 124, 'Intestinal infection with amoebae.', 'en', 1, '2004-01-01 00:00:00', 1, NULL, '123FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(139, 140, 'A contagious skin disease caused by a parasitic mite (Sarcoptes scabiei) and characterized by intense itching.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:51:49', '139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(154, 155, 'Any of various neurological disorders characterized by sudden recurring attacks of motor, sensory, or psychic malfunction with or without loss of consciousness or convulsive seizures.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:52:35', '154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(200, 199, 'A disease caused by infestation with parasitic worms.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:56:07', '200FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(207, 206, 'Epileptic seizure of unspecified type.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:56:45', '207FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(231, 230, 'Vaginal bleeding in a pregnant women after birth.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:57:33', '231FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(460, 460, 'An abnormal excess accumulation of serous fluid in connective tissue or in a serous cavity.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:59:27', '460FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(512, 512, 'DEF: Lesion of the skin. DESC: The history of the particular skin lesions is also important, including time and site of initial appearance, spread, change in appearance, and triggering factors. Visual inspection is the central evaluation tool; many skin diseases are diagnosed by the characteristic appearance or morphology of the lesions. REF: Merck Manual', 'en', 1, '2004-01-01 00:00:00', 1, NULL, '512FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(832, 832, 'Clinical finding of weight loss, less severe than the wasting syndrome.', 'en', 1, '2004-05-04 00:00:00', 1, '2012-10-10 16:19:16', '832FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(840, 840, 'The presence of blood or blood cells in the urine.', 'en', 1, '2004-05-04 00:00:00', 1, '2012-06-12 21:51:48', '840FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(882, 879, 'The sensation in the skin that encourages itching or scratching.', 'en', 1, '2004-05-05 00:00:00', 1, NULL, '882FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(895, 892, 'An acute contagious disease especially of children that is marked by low-grade fever and formation of vesicles and that is caused by a herpesvirus.', 'en', 1, '2004-06-02 00:00:00', 1, '2012-07-09 15:37:11', '895FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1002, 1000, 'Blood samples not separated into subtypes (RBC, WBC, Platelets)', 'en', 1, '2004-12-02 00:00:00', 1, '2013-07-31 15:15:15', '1002FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1003, 1001, 'Blood supernatent product after blood clots', 'en', 1, '2004-12-02 00:00:00', 1, '2014-05-16 15:25:29', '1003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
