(4719, 116376, 'A sudden, nonconvulsive loss of neurologic function due to an ischemic or hemorrhagic intracranial vascular event. In general, cerebrovascular accidents are classified by anatomic location in the brain, vascular distribution, etiology, age of the affected individual, and hemorrhagic vs. nonhemorrhagic nature. (From Adams et al., Principles of Neurology, 6th ed, pp777-810)', 'en', 1, '2007-10-18 04:28:24', 1, NULL, '4719FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
