(5764, 119558, 'Localized destruction of the tooth surface initiated by decalcification of the enamel followed by enzymatic lysis of organic structures and leading to cavity formation. If left unchecked, the cavity may penetrate the enamel and dentin and reach the pulp. The three most prominent theories used to explain the etiology of the disase are that acids produced by bacteria lead to decalcification; that micro-organisms destroy the enamel protein; or that keratolytic micro-organisms produce chelates that lead to decalcification.', 'en', 1, '2007-11-02 20:08:47', 1, '2011-12-22 18:39:36', '5764FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
