(9762, 132636, 'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning "displaced child". Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)', 'en', 1, '2007-10-18 04:28:24', 1, NULL, '9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
