(1, 'Check In', 'Indicates the patient has done the required paperwork and check-in to begin a visit to the clinic/hospital.', 2, '2013-08-02 08:13:23', 0, NULL, NULL, NULL, 'ca3aed11-1aa4-42a1-b85c-8332fc8001fc', NULL, NULL),
(2, 'Vitals', 'For capturing vital signs', 2, '2013-08-12 15:08:05', 0, NULL, NULL, NULL, '67a71486-1a54-468f-ac3e-7091a9a79584', NULL, NULL),
(3, 'Discharge', 'Indicates that a patient''s inpatient care at the hospital is ending, and they are expected to leave soon.', 2, '2013-08-01 21:27:50', 0, NULL, NULL, NULL, '181820aa-88c9-479b-9077-af92f5364329', NULL, NULL),
(4, 'Admission', 'Indicates that the patient has been admitted for inpatient care, and is not expected to leave the hospital unless discharged.', 2, '2013-08-01 21:27:27', 0, NULL, NULL, NULL, 'e22e39fd-7db2-45e7-80f1-60fa0d5a4378', NULL, NULL),
(5, 'Visit Note', 'Encounter where a full or abbreviated examination is done, usually leading to a presumptive or confirmed diagnosis, recorded by the examining clinician.', 2, '2013-08-02 08:16:06', 0, NULL, NULL, NULL, 'd7151f82-c1f3-4152-a605-2f9ea7414a79', NULL, NULL),
(6, 'Check Out', 'The patient is explicitly leaving the hospital/clinic. (Usually no formal encounter is captured for this.)', 2, '2013-08-02 08:14:43', 0, NULL, NULL, NULL, '25a042b2-60bc-4940-a909-debd098b7d82', NULL, NULL),
(7, 'Transfer', 'Indicates that a patient is being transferred into a different department within the hospital. (Transfers out of the hospital should not use this encounter type.)', 2, '2013-08-01 21:28:10', 0, NULL, NULL, NULL, '7b68d557-85ef-4fc8-b767-4fa4f5eb5c23', NULL, NULL);
