('patient.nameValidationRegex', NULL, 'Names of the patients must pass this regex. Eg : ^[a-zA-Z \\-]+$ contains only english alphabet letters, spaces, and hyphens. A value of .* or the empty string means no validation is done.', '89ce789b-c939-4d37-892a-88d0f7e4baf4', NULL, NULL, NULL, NULL),
