(26, 'OPD diagnosis', 'Breakdown by age and gender', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="98864af1-5b10-4016-9e83-8279b1dd8059" retired="false">\n  <name>OPD diagnosis</name>\n  <description>Breakdown by age and gender</description>\n  <creator class="org.openmrs.User_$$_jvst7d9_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-09-01 11:25:42 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvst7d9_4e" reference="2"/>\n  <dateChanged id="4">2015-11-23 14:00:27 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>Location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>26</id>\n  <sqlQuery>SELECT cn.name, p.gender, if(YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5)) &gt;= 18, &apos;&gt;=18&apos;,&apos;&lt;18&apos;) as age, &#xd;\ncount(cn.name) as Count FROM `obs` as o inner join concept_name as cn on cn.concept_id = o.value_coded inner join person as p on p.person_id = o.person_id inner join concept as c on c.concept_id = cn.concept_id&#xd;\nwhere (:Location IS NOT NULL and location_id =:Location and c.class_id = 13 and cn.locale = &quot;en&quot;) &#xd;\nor (:Location IS NULL and c.class_id = 13 and cn.locale = &quot;en&quot;) &#xd;\ngroup by cn.name, p.gender</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-09-01 14:25:42', 1, '2015-11-23 16:00:27', 1, 0, NULL, NULL, NULL, '98864af1-5b10-4016-9e83-8279b1dd8059'),
