as c on c.concept_id = cn.concept_id&#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and c.class_id = 30 and cn.locale = &quot;en&quot; &#xd;\ngroup by cn.name</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-09-21 15:52:20', 1, '2015-11-24 16:45:29', 1, 0, NULL, NULL, NULL, 'e9bd5a88-5d38-4d16-9f4d-710968f3f03a'),
