rson_id inner join person_attribute as pa on pa.person_id = obs.person_id&#xd;\nwhere concept.class_id = 26 and locale = &apos;en&apos; and person_attribute_type_id = 22 and obs.value_coded in (162759) ) as o inner join &#xd;\n(select concept_name.name, value_coded, obs_group_id from `obs` inner join concept on obs.value_coded = concept.concept_id inner join `concept_name` on `concept_name`.concept_id = obs.value_coded where concept.class_id = 27 and locale = &apos;en&apos;) as oo on &#xd;\no.obs_group_id = oo.obs_group_id and o.value_coded != oo.value_coded&#xd;\nWhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  &#xd;\ngroup by Vaccine, status, gender</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-09-29 17:05:33', 1, '2015-11-24 16:48:15', 1, 0, NULL, NULL, NULL, '10cba6cf-ef19-41f1-908b-95fc8f0bda43');
