(42, 'Delivery Care', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="4707f559-03d8-427b-9a72-c36ccbee697f" retired="false">\n  <name>Delivery Care</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvsta5b_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-10-01 08:02:59 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvsta5b_4e" reference="2"/>\n  <dateChanged id="4">2015-11-24 14:41:31 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="7">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>42</id>\n  <sqlQuery>select cn.name as name, pa.value as status,&#xd;\ncase when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;=18 then &apos;&gt;=18&apos; &#xd;\n  when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, Home_Clinic, COUNT(value_coded) as Count from (SELECT encounter_id, if(value_coded = 1065, &apos;Home&apos;,&apos;Clinic&apos;) as &apos;Home_Clinic&apos; from obs&#xd;\nwhere concept_id = 162870) as home_d inner join obs on home_d.encounter_id = obs.encounter_id and obs.concept_id in (162867, 162869, 162866, 162815, 162891) and value_coded = 1065 inner join concept_name as cn on cn.concept_id = obs.concept_id inner join person as p on p.person_id = obs.person_id inner join person_attribute as pa on pa.person_id = obs.person_id &#xd;\nwhere locale = &quot;en&quot; and person_attribute_type_id = 22&#xd;\ngroup by name, status, age, Home_Clinic&#xd;\n&#xd;\n&#xd;\nunion&#xd;\n&#xd;\nselect &quot;Birth Weight &gt;= 2500&quot; as name,pa.value as status,&#xd;\ncase when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;=18 then &apos;&gt;=18&apos; &#xd;\n  when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, Home_Clinic, sum( if(value_numeric &gt;= 2500, 1, 0) ) as Count from (SELECT encounter_id, if(value_coded = 1065, &apos;Home&apos;,&apos;Clinic&apos;) as &apos;Home_Clinic&apos; from obs&#xd;\nwhere concept_id = 162870) as home_d inner join obs on home_d.encounter_id = obs.encounter_id and value_numeric IS NOT NULL inner join person as p on p.person_id = obs.person_id inner join person_attribute as pa on pa.person_id = obs.person_id &#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and person_attribute_type_id = 22&#xd;\ngroup by  name, status, age, Home_Clinic&#xd;\n&#xd;\nunion&#xd;\n&#xd;\nselect &quot;Birth Weight &lt; 2500&quot; as name, pa.value as status,&#xd;\ncase when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;= 18 then &apos;&gt;=18&apos; &#xd;\n  when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, Home_Clinic, sum( if(value_numeric &lt; 2500, 1, 0) ) as Count from (SELECT encounter_id, if(value_coded = 1065, &apos;Home&apos;,&apos;Clinic&apos;) as &apos;Home_Clinic&apos; from obs&#xd;\nwhere concept_id = 162870) as home_d inner join obs on home_d.encounter_id = obs.encounter_id and value_numeric IS NOT NULL inner join person as p on p.person_id = obs.person_id inner join person_attribute as pa on pa.person_id = obs.person_id &#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and person_attribute_type_id = 22&#xd;\ngroup by  name, status, age, Home_Clinic</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-01 11:02:59', 1, '2015-11-24 16:41:31', 1, 0, NULL, NULL, NULL, '4707f559-03d8-427b-9a72-c36ccbee697f'),
(43, 'Postnatal Care - Attended for first postnatal visit within 3 days of delivery', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="9b231a18-cbec-4ca8-adb4-a92b1786ae60" retired="false">\n  <name>Postnatal Care - Attended for first postnatal visit within 3 days of delivery</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvsta5b_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-10-02 06:52:52 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvsta5b_4e" reference="2"/>\n  <dateChanged id="4">2015-11-24 14:44:36 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="7">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>43</id>\n  <sqlQuery>select pa.value as status, case when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;= 18 then &apos;&gt;=18&apos; &#xd;\n	 when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, Count(days) as  &quot;Attended for first postnatal visit within 3 days of delivery&quot; from &#xd;\n(select datediff(PNC1_date, delievery_date) as days, o1.person_id as all_person_id  from &#xd;\n	(SELECT person_id, obs_datetime as delievery_date FROM `obs` WHERE value_coded = 162816) as o1 inner join &#xd;\n	(SELECT person_id, obs_datetime as PNC1_date FROM `obs` WHERE value_coded = 162812) as o2 on o1.person_id = o2.person_id&#xd;\n) as days_tb inner join person as p on p.person_id = all_person_id inner join person_attribute as pa on pa.person_id = all_person_id&#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and days_tb.days &lt;= 3 and  person_attribute_type_id = 22 &#xd;\ngroup by  status, age</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-02 09:52:52', 1, '2015-11-24 16:44:37', 1, 0, NULL, NULL, NULL, '9b231a18-cbec-4ca8-adb4-a92b1786ae60'),
