 person_id, obs_datetime as delievery_date FROM `obs` WHERE value_coded = 162816) as o1 inner join &#xd;\n	(SELECT person_id, obs_datetime as PNC1_date FROM `obs` WHERE value_coded = 162812) as o2 on o1.person_id = o2.person_id&#xd;\n) as days_tb inner join person as p on p.person_id = all_person_id inner join person_attribute as pa on pa.person_id = all_person_id&#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and days_tb.days &lt;= 3 and  person_attribute_type_id = 22 &#xd;\ngroup by  status, age</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-02 10:46:44', 1, '2015-11-24 16:44:25', 1, 0, NULL, NULL, NULL, '675a0ffc-68ff-433b-98ec-ca315cd017b9'),
(45, 'Antenatal Care - Number of pregnant women at time of delivery who Received 4 or more antenatal visits', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="3aaf9c78-dfe0-49db-83c3-640717571650" retired="false">\n  <name>Antenatal Care - Number of pregnant women at time of delivery who Received 4 or more antenatal visits</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvsta5b_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-10-05 08:55:23 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvsta5b_4e" reference="2"/>\n  <dateChanged id="4">2015-11-24 14:35:23 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="7">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>45</id>\n  <sqlQuery>select pa.value as status, case when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;= 18 then &apos;&gt;=18&apos; &#xd;\n	 when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, count(ancs.person_id) as &quot;Received 4 or more antenatal visits&quot; from &#xd;\n(select person_id, Count(value_coded) as count from obs&#xd;\nwhere value_coded in (162808 , 162809, 162810, 162811)&#xd;\ngroup by  person_id&#xd;\nhaving count &gt; 3) as ancs&#xd;\ninner join person as p on p.person_id = ancs.person_id &#xd;\ninner join person_attribute as pa on pa.person_id = ancs.person_id &#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and person_attribute_type_id = 22 &#xd;\n&#xd;\ngroup by status, age</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-05 11:55:23', 1, '2015-11-24 16:35:24', 1, 0, NULL, NULL, NULL, '3aaf9c78-dfe0-49db-83c3-640717571650'),
(46, 'Antenatal Care - Number of pregnant women at time of delivery who Received 2 doses of tetanus toxioid during antenatal period', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="e356867f-4b60-480f-9bef-6a6bdfa5fbb4" retired="false">\n  <name>Antenatal Care - Number of pregnant women at time of delivery who Received 2 doses of tetanus toxioid during antenatal period</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvsta5b_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-10-08 09:27:09 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvsta5b_4e" reference="2"/>\n  <dateChanged id="4">2015-11-24 14:35:12 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="7">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>46</id>\n  <sqlQuery>Select pa.value as status,&#xd;\ncase when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;=18 then &apos;&gt;=18&apos; &#xd;\n  when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, count(filtered.person_id) as &quot;Received 2 doses of tetanus toxioid during antenatal period&quot; from (Select delivery_included.person_id, Count(*) as count from &#xd;\n(&#xd;\n	select o1.*, o2.obs_datetime as delivery_date from obs as o1 inner join obs as o2 on o1.person_id = o2.person_id and o2.value_coded = 162816  and o1.obs_datetime &lt;= o2.obs_datetime&#xd;\n)as delivery_included&#xd;\nWhere encounter_id in (&#xd;\n    		select encounter_id from obs&#xd;\n			where LEFT(value_text,LOCATE(&apos;^&apos;,value_text) - 1) like 162893&#xd;\n)&#xd;\nAnd value_coded in (162808 , 162809 , 162810 , 162811 )&#xd;\ngroup by person_id&#xd;\nhaving Count &gt;= 2&#xd;\n) as filtered inner join person as p on p.person_id = filtered.person_id inner join person_attribute as pa on pa.person_id = filtered.person_id &#xd;\nwhere  obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and person_attribute_type_id = 22 &#xd;\ngroup by status, age</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-08 12:27:09', 1, '2015-11-24 16:35:12', 1, 0, NULL, NULL, NULL, 'e356867f-4b60-480f-9bef-6a6bdfa5fbb4'),
(47, 'Antenatal Care - Number of pregnant women at time of delivery who Received 1 dose of Albendazole during antenatal period', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="60319ef2-2528-4839-932f-9193ea1ab6d3" retired="false">\n  <name>Antenatal Care - Number of pregnant women at time of delivery who Received 1 dose of Albendazole during antenatal period</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvsta5b_4e" id="2" uuid="86fdb28e-4648-11e5-a918-68f7281066ec"/>\n  <dateCreated id="3">2015-10-08 11:15:36 UTC</dateCreated>\n  <changedBy class="org.openmrs.User_$$_jvsta5b_4e" reference="2"/>\n  <dateChanged id="4">2015-11-24 14:35:01 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>startDate</name>\n      <label>startDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="7">\n      <name>endDate</name>\n      <label>endDate</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>47</id>\n  <sqlQuery>Select pa.value as status,&#xd;\ncase when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &gt;=18 then &apos;&gt;=18&apos; &#xd;\n  when (YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5))) &lt; 18 then &apos;&lt;18&apos;&#xd;\nend as age, count(filtered.person_id) as &quot;Received 1 dose of Albendazole during antenatal period&quot; from (Select delivery_included.person_id, Count(*) as count from &#xd;\n(&#xd;\n	select o1.*, o2.obs_datetime as delivery_date from obs as o1 inner join obs as o2 on o1.person_id = o2.person_id and o2.value_coded = 162816  and o1.obs_datetime &lt;= o2.obs_datetime&#xd;\n)as delivery_included&#xd;\nWhere encounter_id in (&#xd;\n    		select encounter_id from obs&#xd;\n			where LEFT(value_text,LOCATE(&apos;^&apos;,value_text) - 1) like 162635 or&#xd;\n    		      LEFT(value_text,LOCATE(&apos;^&apos;,value_text) - 1) like 162636&#xd;\n                          &#xd;\n)&#xd;\nAnd value_coded in (162808 , 162809 , 162810 , 162811 )&#xd;\ngroup by person_id&#xd;\nhaving Count &gt;= 1&#xd;\n) as filtered inner join person as p on p.person_id = filtered.person_id inner join person_attribute as pa on pa.person_id = filtered.person_id &#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and person_attribute_type_id = 22 &#xd;\ngroup by status, age</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-10-08 14:15:36', 1, '2015-11-24 16:35:02', 1, 0, NULL, NULL, NULL, '60319ef2-2528-4839-932f-9193ea1ab6d3'),
