(53, 'OPD diagnosis', '', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id="1" uuid="d4b33cec-d595-4890-a82e-89196195a3be" retired="false">\n  <name>OPD diagnosis</name>\n  <description></description>\n  <creator class="org.openmrs.User_$$_jvstb_4e" id="2" uuid="00d1db56-5711-4bf1-bd28-d65a877eb204"/>\n  <dateCreated id="3">2015-11-24 08:09:01 UTC</dateCreated>\n  <changedBy reference="2"/>\n  <dateChanged id="4">2015-11-24 08:09:30 UTC</dateChanged>\n  <parameters id="5">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id="6">\n      <name>Location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>53</id>\n  <sqlQuery>SELECT cn.name, p.gender, if(YEAR(CURRENT_TIMESTAMP) - YEAR(`birthdate`) - (RIGHT(CURRENT_TIMESTAMP, 5) &lt; RIGHT(`birthdate`, 5)) &gt;= 18, &apos;&gt;=18&apos;,&apos;&lt;18&apos;) as age, &#xd;\ncount(cn.name) as Count FROM `obs` as o inner join concept_name as cn on cn.concept_id = o.value_coded inner join person as p on p.person_id = o.person_id inner join concept as c on c.concept_id = cn.concept_id&#xd;\nwhere (:Location IS NOT NULL and location_id =:Location and c.class_id = 13 and cn.locale = &quot;en&quot;) &#xd;\nor (:Location IS NULL and c.class_id = 13 and cn.locale = &quot;en&quot;) &#xd;\ngroup by cn.name, p.gender</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-11-24 10:09:01', 6, '2015-11-24 10:09:31', 6, 0, NULL, NULL, NULL, 'd4b33cec-d595-4890-a82e-89196195a3be'),
