id = cn.concept_id&#xd;\nwhere obs_datetime &gt;= :startDate and obs_datetime &lt; :endDate  and  ((:location IS NOT NULL and location_id =:location and c.class_id = 13 and cn.locale = &quot;en&quot;) or (:location IS NULL and c.class_id = 13 and cn.locale = &quot;en&quot;) )&#xd;\ngroup by cn.name, p.gender </sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2015-11-24 14:58:30', 1, '2015-11-24 16:32:31', 1, 0, NULL, NULL, NULL, '3a07e6cb-4395-4707-8dbc-da0dd92b0325');
